import React ,{ Component } from "react";

class PharmacoTool extends Component{
    constructor(props){
        super(props)
    }
    render(){
        return(
            <div>
                <h1>{this.props.status?'true':'false'}</h1>
            </div>
        )
    }
}
export default PharmacoTool;
